/*---------------------------------
共通設定
---------------------------------*/
//変数
var windowWidth = $(window).width();
var windowHeight = $(window).height();
var breakPoint = 991;

//スクロール固定
var beginScrollBlock = function() {
  beginscrollTop = $(window).scrollTop();
  $('body').addClass('no_scroll').css('top', (-beginscrollTop) + 'px');
};
var endScrollBlock = function() {
  $('body').removeClass('no_scroll');
  $(window).scrollTop(beginscrollTop);
};

//device sp 判定
function isSp_device() {
    if ((navigator.userAgent.indexOf('iPhone') > 0 && navigator.userAgent.indexOf('iPad') == -1) || navigator.userAgent.indexOf('iPod') > 0 || navigator.userAgent.indexOf('Android') > 0) {
        return true;
    }else{
        return false;
    }
}
//ブラウザサイズ sp 判定
var isSp = function(){
  if (!window.innerWidth){
    return false;
  }
  if(!window.matchMedia){
    return (window.innerWidth <= breakPoint) ? true : false;
  }
  if(window.matchMedia('(max-width:'+breakPoint+'px)').matches){
    return true;
  } else {
    return false;
  }
}

//ブラウザ判定
function browser_name() {
  var userAgent = window.navigator.userAgent.toLowerCase();
  var appVersion = window.navigator.appVersion.toLowerCase();
  if (userAgent.indexOf("msie") > -1) {
    if (appVersion.indexOf("msie 6.0") > -1) {return 'ie6';}
    else if (appVersion.indexOf("msie 7.0") > -1) {return 'ie7';}
    else if (appVersion.indexOf("msie 8.0") > -1) {return 'ie8';}
    else if (appVersion.indexOf("msie 9.0") > -1) {return 'ie9';}
    else if (appVersion.indexOf("msie 10.0") > -1) {return 'ie10';}
    else {return 'unknown';}
  }
  else if (userAgent.indexOf("trident/7.0") > -1) {return 'ie11';}
  else if (userAgent.indexOf("edge") > -1) {return 'edge';}
  else if (userAgent.indexOf("firefox") > -1) {return 'firefox';}
  else if (userAgent.indexOf("opera") > -1) {return 'opera';}
  else if (userAgent.indexOf("chrome") > -1) {return 'chrome';}
  else if (userAgent.indexOf("safari") > -1) {return 'safari';}
  else {return 'unknown';}
}

//アニメーション
function inview() {
  $('.fadeIn_off').on('inview', function(event, isInView, visiblePartX, visiblePartY) {
      if(isInView){
        $(this).stop().addClass('fadeIn_on');
        //li fade in
        if($(this).find('ul.list-fade-in li').length){
          $(this).find('ul.list-fade-in li').each(function(i) {
            $(this).delay(300 * i).animate({
              opacity: "1"
            }, 500);
          });
        }
        //
        if($(this).find('dl.list-fade-in dt').length){
          $(this).find('dl.list-fade-in dt').each(function(i) {
            $(this).delay(300 * i).animate({
              opacity: "1"
            }, 500);
          });
        }
      }else{
        //$(this).stop().removeClass('fadeIn_on');
      }
  });
}

//tile js
function tileList($element,$leaight){
    $($element).tile($leaight);
}


/*---------------------------------
MP.mentepro.common : 共通
---------------------------------*/
MP.mentepro.common = function () {

  //Smooth scroll
  $('a[href^="#"]').not('.content-wrap__swiper a').on('click', function () {
    var speed = 600;
    var href= $(this).attr("href");
    var target = $(href == "#" || href == "" ? 'html' : href);
    var position = target.offset().top;

    $("html, body").animate({scrollTop:position}, speed, "swing");
    return false;
  });

  //var chekflag = false;
  //scroll nav
  // $(window).on('scroll', function(){
  //   var st = $(this).scrollTop();
  //   var h = $('header');
  //   var hc = $('header .container');
  //   var mv = $('.main-visual').offset().top;
  //
  //   if (0 < st) {
  //     h.addClass('scroll');
  //   }else{
  //     h.removeClass('scroll');
  //   }
  // });

  //back to top
  $('#backtop').on('click', function () {
        $('html,body').animate({
            scrollTop: 0
        }, 600, 'swing');
  });

};//MP.mentepro.common END


/*---------------------------------
MP.mentepro.top : トップページ
---------------------------------*/
MP.mentepro.top = function () {

  //スクロールイベント
  inview();

  $(window).on("resize load",function(){

    //load animation
    $('header h1,header .tel-box,header .btn-mail').addClass('st');
    setTimeout(function(){
        $('header nav').addClass('st');
    },500);

    //ご利用の流れ要素の高さそろえる
    if(isSp()){
      $('.section-point ul li .inner-box,.section-flow ul li,.section-contact ul li').css('height','inherit');
    }else{
      tileList('.section-point ul li .inner-box','3');
      tileList('.section-flow ul li','7');
      tileList('.section-contact ul li','2');
    }
  });

  //よくあるご質問クリック
  $('.section-faq dl dt').on('click',function(){
    $(this).toggleClass('open').next().slideToggle();
  });

  //form
  function formchange(){
    var input = ['.form-box input[type="text"]', '.form-box input[type="tel"]' , '.form-box input[type="email"]'];
    for(let i = 0; i < input.length; i++) {
      var num = input[i];
      $(num).prop('disabled', true);
      if($(num)[0]){
        $(num).on('change',function() {
          if($(this).hasClass('st')){
            if(!$(this).val() == ""){
              $(this).removeClass('st');
              $(this).next('.form-box input').not('.form-box input[type="image"]').addClass('st').prop('disabled', false);
            }
          }
        });
      }
    }
    $('.form-box select.st').change(function(){
      $(this).removeClass('st');
      $(this).next('input').addClass('st').prop('disabled', false);
    });
  }
  formchange();

  //sp modal
  if(isSp()){
    $('.main-visual .btn-irai,header  .btn-mail ').on('click',function(){
      $('.sp-modal').fadeToggle().scrollTop(0);
      beginScrollBlock();
    });
    $('.sp-modal .btn-close').on('click',function(){
      $('.sp-modal').fadeOut();
      endScrollBlock();
    });
  }

};//MP.mentepro.top END
